import React from "react";

const UpdateLiveStats = (props) => {
  let convertedTime
  convertedTime = props.lastUpdatedTime
  convertedTime = new Date().toUTCString()

  return (
    <div>
      <div>
        <p className="text-muted">Updated AT {convertedTime}</p>
      </div>
    </div>
  );
};

export default UpdateLiveStats;
